import React from 'react';
import { Link } from 'react-router-dom';
import { withAuth } from "../with_auth/with_auth";
import logo from "../../logo.png"

const headerStyle: React.CSSProperties = {
    backgroundColor: "pink",
    height: "100px"
};

interface TopNavBarInternalProps {
    token: string | null;
}

interface TopNavBarInternalState {}

class TopNavBarInternal extends React.Component<TopNavBarInternalProps, TopNavBarInternalState> {
    public render() {
        return (
            <div style = { headerStyle}>
                <Link className="links" to="/">
                    <img 
                        src = {logo}
                        className = "img"
                        style = {{ height: "40px"}}
                    />

                </Link>
                {this._renderSomethingPrivate()}
            </div>
        );
    }

    private _renderSomethingPrivate() {
        const token = this.props.token;
        if (token) {
            return <div>
                        <Link style = {{ marginLeft:"30px", color: "#ffffff" }} to="/profile">
                            <img
                                src = "data:image/jpeg;base64,"
                                style = {{ width: "30px"}}
                            />
                        </Link>
                        <Link style = {{marginLeft:"30px", color: "black" }} to ="/">Log out</Link>
                        <Link style = {{ marginLeft:"30px", color: "#ffffff" }} to="/app">New Post</Link>
                </div>
        } else {
            return <div>
                        <Link style = {{marginTop:"-10px", marginLeft:"30px", color: "black" }} to = "/login">Login</Link>
                        <Link style = {{marginTop:"-10px", marginLeft:"30px", color: "black" }} to = "/register">Register</Link>
                    </div>
        }
    }
}

// withAuth will trigger a re-render
export const TopNavBar = withAuth(props => <TopNavBarInternal token = {props.authToken} />);
